CREATE TABLE `cupons` (
  `id_cupom` int(11) NOT NULL AUTO_INCREMENT,
  `codigo_cupom` varchar(20) NOT NULL,
  `desconto_valor` varchar(50) NOT NULL,
  `desconto_tipo` enum('valor','percentual','frete') NOT NULL DEFAULT 'percentual',
  `descricao` varchar(255) DEFAULT NULL,
  `data_criacao` datetime NOT NULL DEFAULT current_timestamp(),
  `data_validade` datetime NOT NULL,
  `limite_usos` int(11) DEFAULT NULL,
  `usos_atuais` int(11) NOT NULL DEFAULT 0,
  `status` enum('ativo','inativo','expirado') NOT NULL DEFAULT 'ativo',
  PRIMARY KEY (`id_cupom`),
  UNIQUE KEY `codigo_cupom` (`codigo_cupom`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

