  PRIMARY KEY (`id_boleto`),
  KEY `fk_despesa_id` (`fk_despesa_id`),
  CONSTRAINT `fk_boleto_despesa` FOREIGN KEY (`fk_despesa_id`) REFERENCES `despesas` (`id_despesa`) ON DELETE CASCADE
